            <tspan x="0" y="24.3285141" textLength="44.625">Knave</tspan>

            <tspan x="0" y="56.7285156" textLength="76.25">Dormouse</tspan>
            <tspan x="76.25" y="56.7285156" textLength="4.125"> </tspan>
            <tspan x="80.375" y="56.7285156" textLength="18" font-family="新細明體">腫</tspan>
            <tspan x="98.375" y="56.7285156" textLength="18" font-family="新細明體">鼠</tspan>
            <tspan x="0" y="89.12852" textLength="86.625">March Hare</tspan>
            <tspan x="86.625" y="89.12852" textLength="18" font-family="新細明體">三</tspan>
            <tspan x="104.625" y="89.12852" textLength="18" font-family="新細明體">月</tspan>
            <tspan x="122.625" y="89.12852" textLength="18" font-family="新細明體">兔</tspan>
            <tspan x="0" y="121.528519" textLength="198">Act I Down the Rabbit Hole</tspan>
            <tspan x="0" y="153.928528" textLength="405.5">(Alice is very bored. At that time, a white rabbit runs by
            </tspan>
            <tspan x="405.5" y="153.928528" textLength="4.125"> </tspan>
            <tspan x="0" y="186.328522" textLength="34.75">her.)</tspan>
            <tspan x="0" y="218.728516" textLength="44.625">White</tspan>
            <tspan x="44.625" y="218.728516" textLength="4.125"> </tspan>
            <tspan x="48.75" y="218.728516" textLength="73.75">Rabbit:Oh</tspan>
            <tspan x="122.5" y="218.728516" textLength="156.625">! Tin going to be late!</tspan>
            <tspan x="0" y="251.12851" textLength="35.25">Alice</tspan>
            <tspan x="35.25" y="251.12851" textLength="14.5">: (</tspan>
            <tspan x="49.75" y="251.12851" textLength="218.625">excited) A talking rabbit! I can</tspan>
            <tspan x="268.375" y="244.648514" textLength="3.625" font-size="8.91pt">f</tspan>
            <tspan x="272" y="251.12851" textLength="77.25">t believe it</tspan>
            <tspan x="349.25" y="251.12851" textLength="10">.(</tspan>
            <tspan x="359.25" y="251.12851" textLength="76">The White</tspan>
            <tspan x="435.25" y="251.12851" textLength="4.125"> </tspan>
            <tspan x="0" y="283.528534" textLength="254.125">Rabbit jumps into a hole, and Alice</tspan>
            <tspan x="254.125" y="283.528534" textLength="4.125"> </tspan>
            <tspan x="258.25" y="283.528534" textLength="100.25">follows him.)(</tspan>
            <tspan x="358.5" y="283.528534" textLength="57.5">Thump!</tspan>
            <tspan x="416" y="283.528534" textLength="4.125"> </tspan>
            <tspan x="0" y="315.928558" textLength="366.125">Alice is in a long hallway with many locked doors.)</tspan>
            <tspan x="0" y="348.328583" textLength="35.25">Alice</tspan>
            <tspan x="35.25" y="348.328583" textLength="10.375">:(</tspan>
            <tspan x="45.625" y="348.328583" textLength="286.375">curiously) Where am I? Oh, what is this</tspan>
            <tspan x="332" y="348.328583" textLength="13.875">?(</tspan>
            <tspan x="345.875" y="348.328583" textLength="75.75">Alice picks</tspan>
            <tspan x="421.625" y="348.328583" textLength="4.125"> </tspan>
            <tspan x="0" y="380.7286" textLength="291">up a small golden key from a glass table</tspan>
            <tspan x="291" y="380.7286" textLength="15.5">.)(</tspan>
            <tspan x="306.5" y="380.7286" textLength="116.75">opening a door)</tspan>
            <tspan x="423.25" y="380.7286" textLength="4.125"> </tspan>
            <tspan x="0" y="413.128632" textLength="228.125">The key unlocks this small door</tspan>
            <tspan x="228.125" y="413.128632" textLength="10">.(</tspan>
            <tspan x="238.125" y="413.128632" textLength="144.875">looking through the</tspan>
            <tspan x="383" y="413.128632" textLength="4.125"> </tspan>
            <tspan x="0" y="445.528656" textLength="196.875">doorway) What a beautiful</tspan>
            <tspan x="196.875" y="445.528656" textLength="4.125"> </tspan>
            <tspan x="201" y="445.528656" textLength="61.75">garden!I</tspan>
            <tspan x="262.75" y="445.528656" textLength="4.125"> </tspan>
            <tspan x="266.875" y="445.528656" textLength="140.625">want to go into the</tspan>
            <tspan x="407.5" y="445.528656" textLength="4.125"> </tspan>
            <tspan x="0" y="477.92868" textLength="176.125">garden, but I am too big</tspan>
            <tspan x="176.125" y="477.92868" textLength="10">.(</tspan>
            <tspan x="186.125" y="477.92868" textLength="228.375">looking around) Oh, that bottle</tspan>
            <tspan x="414.5" y="477.92868" textLength="4.125"> </tspan>
            <tspan x="0" y="510.3287" textLength="161.625">says &quot;DRINK ME” on it</tspan>
            <tspan x="161.625" y="510.3287" textLength="10">.(</tspan>
            <tspan x="171.625" y="510.3287" textLength="238.75">drinking from the bottle) Oh, I&apos;m</tspan>
            <tspan x="410.375" y="510.3287" textLength="4.125"> </tspan>
            <tspan x="0" y="542.7287" textLength="141">getting smaller and</tspan>
            <tspan x="141" y="542.7287" textLength="4.125"> </tspan>
            <tspan x="145.125" y="542.7287" textLength="82.25">smaller!I&apos;m</tspan>
            <tspan x="227.375" y="542.7287" textLength="4.125"> </tspan>
            <tspan x="231.5" y="542.7287" textLength="200.125">small enough to fit through</tspan>
            <tspan x="431.625" y="542.7287" textLength="4.125"> </tspan>
            <tspan x="0" y="575.128662" textLength="174.25">the door, but it&apos;s locked</tspan>
            <tspan x="174.25" y="575.128662" textLength="11.375">!(</tspan>
            <tspan x="185.625" y="575.128662" textLength="233.875">looking around again) That cake</tspan>
            <tspan x="419.5" y="575.128662" textLength="4.125"> </tspan>
            <tspan x="0" y="607.5286" textLength="129.125">box says &quot;EAT ME</tspan>
            <tspan x="129.125" y="601.048645" textLength="6.25" font-size="8.91pt">n</tspan>
            <tspan x="135.375" y="607.5286" textLength="23.125"> on</tspan>
            <tspan x="158.5" y="607.5286" textLength="4.125"> </tspan>
            <tspan x="162.625" y="607.5286" textLength="65.5">it (eating</tspan>
            <tspan x="228.125" y="607.5286" textLength="4.125"> </tspan>
            <tspan x="232.25" y="607.5286" textLength="200.125">a piece of cake) Oh, no! I&apos;m</tspan>
            <tspan x="432.375" y="607.5286" textLength="4.125"> </tspan>
            <tspan x="0" y="639.9286" textLength="133.375">getting bigger and</tspan>
            <tspan x="133.375" y="639.9286" textLength="4.125"> </tspan>
            <tspan x="137.5" y="639.9286" textLength="85.75">bigger!Now</tspan>
            <tspan x="223.25" y="639.9286" textLength="4.125"> </tspan>
            <tspan x="227.375" y="639.9286" textLength="188">I&apos;m too big! I can&apos;t go into</tspan>
            <tspan x="415.375" y="639.9286" textLength="4.125"> </tspan>
            <tspan x="0" y="672.328552" textLength="85.875">the garden!</tspan>
          </text>
        </g>
      </g>

      <g text-rendering="geometricPrecision" pointer-events="painted" transform="scale(1,1)">
        <rect x="0" y="0" width="540" height="780" fill="#ffffff" />
        <path fill="url(#page11-im7)" d="M383.4 32.8L508.5 32.8 508.5 197.2 383.4 197.2z" />
        <g transform="matrix(1, 0, 0, 1, 35.1218872, 76.08441)">
          <text font-family="Calibri" font-size="13.5pt" fill="#000000">
            <tspan x="0" y="24.3285141" textLength="306.25">(Alice starts crying. Soon her tears make a</tspan>
            <tspan x="306.25" y="24.3285141" textLength="4.125"> </tspan>
            <tspan x="310.375" y="24.3285141" textLength="22.125">big</tspan>
            <tspan x="0" y="56.7285156" textLength="349.75">pool. Suddenly, the White Rabbit runs by Alice.)</tspan>
            <tspan x="0" y="89.12852" textLength="5.5">(</tspan>
            <tspan x="5.5" y="89.12852" textLength="122.875">softly) Please, sir</tspan>
            <tspan x="144" y="89.12852" textLength="61.375">Help me</tspan>
            <tspan x="205.375" y="89.12852" textLength="14.125">. (</tspan>
            <tspan x="219.5" y="89.12852" textLength="142.875">The White Rabbit is</tspan>
            <tspan x="362.375" y="89.12852" textLength="4.125"> </tspan>
            <tspan x="0" y="121.528519" textLength="92.875">surprised.He</tspan>
            <tspan x="92.875" y="121.528519" textLength="4.125"> </tspan>
            <tspan x="97" y="121.528519" textLength="296.875">drops his gloves and fan and runs away.)</tspan>
            <tspan x="0" y="153.928528" textLength="86.25">It&apos;s very hot</tspan>
            <tspan x="86.25" y="153.928528" textLength="11.375">!(</tspan>
            <tspan x="97.625" y="153.928528" textLength="333.75">Alice picks up the gloves and fan and starts to</tspan>
            <tspan x="431.375" y="153.928528" textLength="4.125"> </tspan>
            <tspan x="0" y="186.328522" textLength="78.125">fan herself</tspan>
            <tspan x="78.125" y="186.328522" textLength="31.375">.)Oh</tspan>
            <tspan x="109.5" y="186.328522" textLength="186.625">, I&apos;m growing small again!</tspan>
            <tspan x="0" y="218.728516" textLength="428.125">(Alice runs to get the key, but she slips into the pool of
              her</tspan>
            <tspan x="428.125" y="218.728516" textLength="4.125"> </tspan>
            <tspan x="0" y="251.12851" textLength="72.875">own tears</tspan>
            <tspan x="72.875" y="251.12851" textLength="19.625">.) (</tspan>
            <tspan x="92.5" y="251.12851" textLength="293.5">Alice sees a little mouse splashing in the</tspan>
            <tspan x="386" y="251.12851" textLength="4.125"> </tspan>
            <tspan x="0" y="283.528534" textLength="74.5">water.The</tspan>
            <tspan x="74.5" y="283.528534" textLength="4.125"> </tspan>
            <tspan x="78.625" y="283.528534" textLength="212.25">Mouse and Alice swim to the</tspan>
            <tspan x="290.875" y="283.528534" textLength="4.125"> </tspan>
            <tspan x="295" y="283.528534" textLength="87.375">shore.Many</tspan>
            <tspan x="382.375" y="283.528534" textLength="4.125"> </tspan>
            <tspan x="386.5" y="283.528534" textLength="54.875">strange</tspan>
            <tspan x="441.375" y="283.528534" textLength="4.125"> </tspan>
            <tspan x="0" y="315.928558" textLength="385.25">birds and animals sit on the shore . Everyone is wet.)
            </tspan>
            <tspan x="0" y="348.328583" textLength="39.625">Dodo</tspan>
            <tspan x="39.625" y="348.328583" textLength="42.625">: Let&apos;s</tspan>
            <tspan x="82.25" y="348.328583" textLength="4.125"> </tspan>
            <tspan x="86.375" y="348.328583" textLength="308.25">have a Caucus Race! That will make us dry</tspan>
            <tspan x="394.625" y="348.328583" textLength="14.125">. (</tspan>
            <tspan x="408.75" y="348.328583" textLength="27.25">The</tspan>
            <tspan x="436" y="348.328583" textLength="4.125"> </tspan>
            <tspan x="0" y="380.7286" textLength="231.375">animals and birds run in a circle</tspan>
            <tspan x="231.375" y="380.7286" textLength="47.375">.) Stop</tspan>
            <tspan x="278.75" y="380.7286" textLength="131">! The race is over!</tspan>
            <tspan x="409.75" y="380.7286" textLength="4.125"> </tspan>
            <tspan x="0" y="413.128632" textLength="152">Everyone is dry now.</tspan>
            <tspan x="0" y="445.528656" textLength="35.25">Alice</tspan>
            <tspan x="35.25" y="445.528656" textLength="14.5">: (</tspan>
            <tspan x="49.75" y="445.528656" textLength="139.625">sadly) I miss Dinah.</tspan>
            <tspan x="0" y="477.92868" textLength="39.625">Dodo</tspan>
            <tspan x="39.625" y="477.92868" textLength="44">: Who</tspan>
            <tspan x="83.625" y="477.92868" textLength="4.125"> </tspan>
            <tspan x="87.75" y="477.92868" textLength="66.5">is Dinah?</tspan>
            <tspan x="0" y="510.3287" textLength="35.25">Alice</tspan>
            <tspan x="35.25" y="510.3287" textLength="51.875">: Dinah</tspan>
            <tspan x="87.125" y="510.3287" textLength="4.125"> </tspan>
            <tspan x="91.25" y="510.3287" textLength="257.375">is my cat. She is a great bird hunter</tspan>
            <tspan x="348.625" y="510.3287" textLength="4.125"> </tspan>
            <tspan x="352.75" y="510.3287" textLength="18" font-family="新細明體">一</tspan>
            <tspan x="370.75" y="510.3287" textLength="4.625" font-family="新細明體"> </tspan>
            <tspan x="375.375" y="510.3287" textLength="25.875">Oh,</tspan>
            <tspan x="0" y="542.7287" textLength="77.375">I am sorry.</tspan>
            <tspan x="0" y="575.128662" textLength="394.625">(All the birds and animals leave • Alice is alone again.)
            </tspan>
          </text>
        </g>
      </g>

            <tspan x="0" y="77.30085" textLength="369.125" fill="#000000">They are resting their elbows on a sleeping
              Dormouse.)</tspan>
            <tspan x="0" y="104.30085" textLength="36.75" fill="#000000">Alice:</tspan>
            <tspan x="36.75" y="104.30085" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="37.875" y="104.30085" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="39" y="104.30085" textLength="104.25" fill="#000000">May I sit down?</tspan>
            <tspan x="0" y="131.300858" textLength="392.375" fill="#000000">March Hare &amp; Hatter: (angrily) No, you
              may not. There&apos;s no</tspan>
            <tspan x="392.375" y="131.300858" textLength="4.125"> </tspan>
            <tspan x="0" y="158.300858" textLength="38.375" fill="#000000">room!</tspan>
            <tspan x="0" y="185.300858" textLength="36.75" fill="#000000">Alice:</tspan>
            <tspan x="36.75" y="185.300858" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="37.875" y="185.300858" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="39" y="185.300858" textLength="362.375" fill="#000000">(sitting down) There&apos;s plenty of
              room!(The Hatter takes</tspan>
            <tspan x="401.375" y="185.300858" textLength="4.125"> </tspan>
            <tspan x="0" y="212.300858" textLength="217.625" fill="#000000">his watch and looks at it.) Hatter:</tspan>
            <tspan x="217.625" y="212.300858" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="218.75" y="212.300858" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="219.875" y="212.300858" textLength="191.875" fill="#000000">(turning to Alice) What day is</tspan>
            <tspan x="411.75" y="212.300858" textLength="4.125"> </tspan>
            <tspan x="0" y="239.300858" textLength="15.875" fill="#000000">it?</tspan>
            <tspan x="0" y="266.300842" textLength="36.75" fill="#000000">Alice:</tspan>
            <tspan x="36.75" y="266.300842" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="37.875" y="266.300842" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="39" y="266.300842" textLength="110.875" fill="#000000">It is Wednesday.</tspan>
            <tspan x="0" y="293.300842" textLength="45" fill="#000000">Hatter:</tspan>
            <tspan x="45" y="293.300842" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="46.125" y="293.300842" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="47.25" y="293.300842" textLength="237.625" fill="#000000">(sadly) Oh, my watch says Monday!
            </tspan>
            <tspan x="0" y="320.300842" textLength="36.75" fill="#000000">Alice:</tspan>
            <tspan x="36.75" y="320.300842" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="37.875" y="320.300842" textLength="1.125" font-size="3pt"> </tspan>
            <tspan x="39" y="320.300842" textLength="377.625" fill="#000000">That&apos;s strange. The watch tells you
              the day, but it doesn&apos;t</tspan>
            <tspan x="416.625" y="320.300842" textLength="4.125"> </tspan>
            <tspan x="0" y="347.300842" textLength="109.25" fill="#000000">tell you the time.</tspan>
          </text>
        </g>
      </g>
    </svg></div>

      <g text-rendering="geometricPrecision" pointer-events="painted" transform="scale(1,1)">
        <rect x="0" y="0" width="540" height="780" fill="#ffffff" />
        <path fill="url(#page11-im9)" d="M27.9 395.7L513.9 395.7 513.9 647.1 27.9 647.1z" />
        <g transform="matrix(1, 0, 0, 1, 45.6746368, 81.75433)">
          <text font-family="Arial" font-size="11.25pt" fill="#000000">
            <tspan x="0" y="21.0617" textLength="45">Hatter:</tspan>
            <tspan x="0" y="48.0617" textLength="19.25">Do</tspan>
            <tspan x="19.25" y="48.0617" textLength="4.125"> </tspan>
            <tspan x="23.375" y="48.0617" textLength="358.875">you think so? Then does your watch tell you the year?
            </tspan>
            <tspan x="0" y="75.0617" textLength="32.625">Alice</tspan>
            <tspan x="32.625" y="75.0617" textLength="27.5">: No</tspan>
            <tspan x="60.125" y="75.0617" textLength="286.25">, but it&apos;s the same year for a very long time.
            </tspan>
            <tspan x="0" y="102.0617" textLength="40.875">Hatter</tspan>
            <tspan x="40.875" y="102.0617" textLength="35">: And</tspan>
            <tspan x="75.875" y="102.0617" textLength="4.125"> </tspan>
            <tspan x="80" y="102.0617" textLength="359.5">my watch doesn&apos;t tell the time because it&apos;s always
              tea-</tspan>
            <tspan x="0" y="129.0617" textLength="32.5">time.</tspan>
            <tspan x="0" y="156.0617" textLength="32.625">Alice</tspan>
            <tspan x="32.625" y="156.0617" textLength="13.25">: (</tspan>
            <tspan x="45.875" y="156.0617" textLength="315.875">saying to herself) Well, I don&apos;t really understand
            </tspan>
            <tspan x="361.75" y="156.0617" textLength="4.125">.</tspan>
            <tspan x="0" y="183.020691" textLength="137.625">March Hare &amp; Hatter</tspan>
            <tspan x="137.625" y="183.020691" textLength="15" font-family="Microsoft JhengHei">：</tspan>
            <tspan x="152.625" y="183.020691" textLength="69.375">Dormouse</tspan>
            <tspan x="222" y="183.020691" textLength="201.75">, we are bored. Tell us a story!</tspan>
            <tspan x="0" y="210.0617" textLength="69.375">Dormouse</tspan>
            <tspan x="69.375" y="210.0617" textLength="9.125">:(</tspan>
            <tspan x="78.5" y="210.0617" textLength="347.125">sleepily) Once upon a time, there were three sisters.
            </tspan>
            <tspan x="0" y="237.0617" textLength="234.625">Their names were Elsie, Lacie, and</tspan>
            <tspan x="234.625" y="237.0617" textLength="4.125"> </tspan>
            <tspan x="238.75" y="237.0617" textLength="68.5">Tillie.They</tspan>
            <tspan x="307.25" y="237.0617" textLength="4.125"> </tspan>
            <tspan x="311.375" y="237.0617" textLength="107">were learning to</tspan>
            <tspan x="418.375" y="237.0617" textLength="4.125"> </tspan>
            <tspan x="0" y="264.0617" textLength="36.75">draw.</tspan>
            <tspan x="0" y="291.0617" textLength="32.625">Alice</tspan>
            <tspan x="32.625" y="291.0617" textLength="4.125">:</tspan>
            <tspan x="36.75" y="291.0617" textLength="3.375" font-size="9pt"> </tspan>
            <tspan x="40.125" y="291.0617" textLength="136.875">What did they draw?</tspan>
          </text>
        </g>
      </g>

      <g text-rendering="geometricPrecision" pointer-events="painted" transform="scale(1,1)">
        <rect x="0" y="0" width="540" height="780" fill="#ffffff" />
        <g transform="matrix(1, 0, 0, 1, 33.3933868, 30.7250519)">
          <text font-family="Calibri" font-size="13.5pt" fill="#000000">
            <tspan x="0" y="24.3285141" textLength="76.25">Dormouse</tspan>
            <tspan x="76.25" y="24.3285141" textLength="14.5">: (</tspan>
            <tspan x="90.75" y="24.3285141" textLength="338.375">yawning) They drew things beginning with the</tspan>
            <tspan x="429.125" y="24.3285141" textLength="4.125"> </tspan>
            <tspan x="0" y="56.7285156" textLength="40.375">letter</tspan>
            <tspan x="40.375" y="56.7285156" textLength="4.125"> </tspan>
            <tspan x="44.5" y="56.7285156" textLength="48.75">M.Like</tspan>
            <tspan x="93.25" y="56.7285156" textLength="4.125"> </tspan>
            <tspan x="97.375" y="56.7285156" textLength="280.75">mousetraps, the moon, and muchness</tspan>
            <tspan x="378.125" y="56.7285156" textLength="10">.(</tspan>
            <tspan x="388.125" y="56.7285156" textLength="27.25">The</tspan>
            <tspan x="415.375" y="56.7285156" textLength="4.125"> </tspan>
            <tspan x="0" y="89.12852" textLength="171.125">Dormouse falls asleep.)</tspan>
            <tspan x="0" y="121.528519" textLength="80.25">Alice:What</tspan>
            <tspan x="80.25" y="121.528519" textLength="4.125"> </tspan>
            <tspan x="84.375" y="121.528519" textLength="228.875">is muchness? (Nobody answers</tspan>
            <tspan x="313.25" y="121.528519" textLength="35.625">.)I&apos;ve</tspan>
            <tspan x="348.875" y="121.528519" textLength="4.125"> </tspan>
            <tspan x="353" y="121.528519" textLength="88.875">never heard</tspan>
            <tspan x="441.875" y="121.528519" textLength="4.125"> </tspan>
            <tspan x="0" y="153.928528" textLength="15">of</tspan>
            <tspan x="15" y="153.928528" textLength="4.125"> </tspan>
            <tspan x="19.125" y="153.928528" textLength="108.75">muchness!This</tspan>
            <tspan x="127.875" y="153.928528" textLength="4.125"> </tspan>
            <tspan x="132" y="153.928528" textLength="284.25">is a stupid tea party! (Alice gets up and</tspan>
            <tspan x="416.25" y="153.928528" textLength="4.125"> </tspan>
            <tspan x="0" y="186.328522" textLength="83.125">walks away</tspan>
            <tspan x="83.125" y="186.328522" textLength="15.5">.)(</tspan>
            <tspan x="98.625" y="186.328522" textLength="275">Alice sees a big tree with a door in it.)</tspan>
            <tspan x="0" y="218.728516" textLength="73.75">Alice:How</tspan>
            <tspan x="73.75" y="218.728516" textLength="4.125"> </tspan>
            <tspan x="77.875" y="218.728516" textLength="275.25">strange! Anyway, I&apos;ll go into the door.</tspan>
            <tspan x="0" y="251.12851" textLength="279.75">(Alice is back in the long hallway again</tspan>
            <tspan x="279.75" y="251.12851" textLength="15.5">.)(</tspan>
            <tspan x="295.25" y="251.12851" textLength="147.375">excitedly) Now I can</tspan>
            <tspan x="442.625" y="251.12851" textLength="4.125"> </tspan>
            <tspan x="0" y="283.528534" textLength="387.625">get the key, unlock the door, and go into the garden!
            </tspan>
          </text>
        </g>

            <tspan x="0" y="21.6253471" textLength="169.625">Act III Who Stole the Tarts</tspan>
            <tspan x="169.625" y="21.6253471" textLength="7.375">?</tspan>
            <tspan x="0" y="50.4253464" textLength="467.625">(In the garden, there are the King and Queen of Hearts,

            <tspan x="0" y="136.825348" textLength="21.75">the</tspan>
            <tspan x="21.75" y="136.825348" textLength="3.625"> </tspan>
            <tspan x="25.375" y="136.825348" textLength="44.125">King.In</tspan>
            <tspan x="69.5" y="136.825348" textLength="3.625"> </tspan>
            <tspan x="73.125" y="136.825348" textLength="344.75">the middle of the room, there is a large dish of
              tarts.)</tspan>
            <tspan x="0" y="165.625351" textLength="74">Alice:Ah-ha</tspan>
            <tspan x="74" y="165.625351" textLength="102.5">! This must be a</tspan>
            <tspan x="176.5" y="165.625351" textLength="3.625"> </tspan>
            <tspan x="180.125" y="165.625351" textLength="119.75">courtroom!Maybe</tspan>
            <tspan x="299.875" y="165.625351" textLength="3.625"> </tspan>
            <tspan x="303.5" y="165.625351" textLength="163.5">the Knave of Hearts stole</tspan>
            <tspan x="467" y="165.625351" textLength="3.625"> </tspan>
            <tspan x="0" y="194.425354" textLength="35.375">some</tspan>
            <tspan x="35.375" y="194.425354" textLength="3.625"> </tspan>
            <tspan x="39" y="194.425354" textLength="58.375">tarts.The</tspan>
            <tspan x="97.375" y="194.425354" textLength="3.625"> </tspan>
            <tspan x="101" y="194.425354" textLength="367.25">King must be the judge and the twelve birds and animals
            </tspan>
            <tspan x="468.25" y="194.425354" textLength="3.625"> </tspan>
            <tspan x="0" y="223.225357" textLength="110.875">must be the jury.</tspan>
            <tspan x="0" y="252.02536" textLength="27.75">King</tspan>
            <tspan x="27.75" y="252.02536" textLength="12.75">: (</tspan>
            <tspan x="40.5" y="252.02536" textLength="153">loudly) Read the paper!</tspan>
            <tspan x="0" y="280.825348" textLength="85.25">White Rabbit</tspan>
            <tspan x="85.25" y="280.825348" textLength="9.125">:(</tspan>
            <tspan x="94.375" y="280.825348" textLength="156.375">blows his trumpet three</tspan>
            <tspan x="250.75" y="280.825348" textLength="3.625"> </tspan>
            <tspan x="254.375" y="280.825348" textLength="65">times)The</tspan>
            <tspan x="319.375" y="280.825348" textLength="3.625"> </tspan>
            <tspan x="323" y="280.825348" textLength="137.125">Queen of Hearts, she</tspan>
            <tspan x="460.125" y="280.825348" textLength="3.625"> </tspan>
            <tspan x="0" y="309.625336" textLength="221.125">made some tarts, all on a summer</tspan>
            <tspan x="221.125" y="309.625336" textLength="3.625"> </tspan>
            <tspan x="224.75" y="309.625336" textLength="51.625">day;The</tspan>
            <tspan x="276.375" y="309.625336" textLength="3.625"> </tspan>
            <tspan x="280" y="309.625336" textLength="162.125">Knave of Hearts, he stole</tspan>
            <tspan x="442.125" y="309.625336" textLength="3.625"> </tspan>
            <tspan x="0" y="338.425323" textLength="248.25">those tarts, and took them quite away</tspan>
            <tspan x="248.25" y="338.425323" textLength="4">.</tspan>
            <tspan x="0" y="367.2253" textLength="70">Queen:Cut</tspan>
            <tspan x="70" y="367.2253" textLength="3.625"> </tspan>
            <tspan x="73.625" y="367.2253" textLength="150">off the Knave of Hearts</tspan>
            <tspan x="223.625" y="361.4653" textLength="5.375" font-size="7.92pt">1</tspan>
            <tspan x="229" y="367.2253" textLength="41.25"> head!</tspan>
            <tspan x="0" y="396.0253" textLength="39.625">White</tspan>
            <tspan x="39.625" y="396.0253" textLength="3.625"> </tspan>
            <tspan x="43.25" y="396.0253" textLength="70.375">Rabbit:Not</tspan>
            <tspan x="113.625" y="396.0253" textLength="3.625"> </tspan>
            <tspan x="117.25" y="396.0253" textLength="322.5">yet, not yet! We have to call people and ask them</tspan>
            <tspan x="439.75" y="396.0253" textLength="3.625"> </tspan>
            <tspan x="0" y="424.8253" textLength="67">questions.</tspan>
          </text>

        <g transform="matrix(1, 0, 0, 1, 24.9275665, 257.5219)">
          <text font-family="Calibri" font-size="13.5pt" fill="#000000">
            <tspan x="0" y="24.3285141" textLength="455.375">(The White Rabbit blows his trumpet three times and shouts
              a</tspan>
            <tspan x="455.375" y="24.3285141" textLength="4.125"> </tspan>
            <tspan x="0" y="56.7285156" textLength="51.5">name.)</tspan>
            <tspan x="0" y="89.12852" textLength="84.375">The Hatter!</tspan>
            <tspan x="0" y="121.528519" textLength="478.875">(The Hatter comes in with a teacup and some bread-
              and-butter.)</tspan>
            <tspan x="0" y="153.928528" textLength="75">King: Take</tspan>
            <tspan x="75" y="153.928528" textLength="4.125"> </tspan>
            <tspan x="79.125" y="153.928528" textLength="92.125">off your hat!</tspan>
            <tspan x="0" y="186.328522" textLength="47.125">Hatter</tspan>
            <tspan x="47.125" y="186.328522" textLength="14.5">: (</tspan>
            <tspan x="61.625" y="186.328522" textLength="172">shivering) It&apos;s not mine.</tspan>
            <tspan x="0" y="218.728516" textLength="31.5">King</tspan>
            <tspan x="31.5" y="218.728516" textLength="14.5">: (</tspan>
            <tspan x="46" y="218.728516" textLength="111.125">angrily) Stolen!</tspan>
            <tspan x="0" y="251.12851" textLength="47.125">Hatter</tspan>
            <tspan x="47.125" y="251.12851" textLength="14.5">: (</tspan>
            <tspan x="61.625" y="251.12851" textLength="365.25">nervously) No, no! I keep hats to sell. I&apos;m a
              hatter.</tspan>
            <tspan x="0" y="283.528534" textLength="31.5">King</tspan>
            <tspan x="31.5" y="283.528534" textLength="14.5">: (</tspan>
            <tspan x="46" y="283.528534" textLength="339.75">angrily) Don&apos;t be afraid, or Ill cut off your head
            </tspan>
            <tspan x="385.75" y="283.528534" textLength="11.375">!(</tspan>
            <tspan x="397.125" y="283.528534" textLength="78.5">The Hatter</tspan>
            <tspan x="475.625" y="283.528534" textLength="4.125"> </tspan>
            <tspan x="0" y="315.928558" textLength="370.75">says something, but nobody could understand him</tspan>
            <tspan x="370.75" y="315.928558" textLength="37.75">.)You</tspan>
            <tspan x="408.5" y="315.928558" textLength="4.125"> </tspan>
            <tspan x="412.625" y="315.928558" textLength="52.375">can go.</tspan>
            <tspan x="0" y="348.328583" textLength="215.25">(Alice is getting bigger again.)</tspan>
            <tspan x="0" y="380.7286" textLength="106.625">Dormouse: Oh</tspan>
            <tspan x="106.625" y="380.7286" textLength="300.25">, I can&apos;t breathe! You&apos;re growing too fast.
            </tspan>
            <tspan x="0" y="413.128632" textLength="48.75">Alice: I</tspan>
            <tspan x="48.75" y="413.128632" textLength="4.125"> </tspan>
            <tspan x="52.875" y="413.128632" textLength="374.625">can&apos;t help it! (The Dormouse suddenly falls
              asleep.)</tspan>
            <tspan x="0" y="445.528656" textLength="31.5">King</tspan>
            <tspan x="31.5" y="445.528656" textLength="35.5">: Call</tspan>
            <tspan x="67" y="445.528656" textLength="4.125"> </tspan>

      <g text-rendering="geometricPrecision" pointer-events="painted" transform="scale(1,1)">
        <rect x="0" y="0" width="540" height="780" fill="#ffffff" />
        <path fill="url(#page11-im13)" d="M65.9 32.8L476.3 32.8 476.3 282.2 65.9 282.2z" />
        <g transform="matrix(1, 0, 0, 1, 47.8174744, 297.211273)">
          <text font-family="Calibri" font-size="13.5pt" fill="#000000">
            <tspan x="0" y="24.3285141" textLength="163">Act IV Alice&apos;s Evidence</tspan>
            <tspan x="0" y="56.7285156" textLength="359.875">(Alice is standing in front of the King and Queen.)</tspan>
            <tspan x="0" y="89.12852" textLength="76.5">King:What</tspan>
            <tspan x="76.5" y="89.12852" textLength="4.125"> </tspan>
            <tspan x="80.625" y="89.12852" textLength="232.625">do you know about these tarts?</tspan>
            <tspan x="0" y="121.528519" textLength="108.875">Alice:Nothing.(</tspan>
            <tspan x="108.875" y="121.528519" textLength="240.375">The King looks at Alice carefully.)</tspan>
            <tspan x="0" y="153.928528" textLength="68.75">King:Rule</tspan>
            <tspan x="68.75" y="153.928528" textLength="4.125"> </tspan>
            <tspan x="72.875" y="153.928528" textLength="273.875">forty-two! All people over a mile high</tspan>
            <tspan x="346.75" y="153.928528" textLength="4.125"> </tspan>
            <tspan x="350.875" y="153.928528" textLength="75.75">mustleave</tspan>
            <tspan x="426.625" y="153.928528" textLength="4.125"> </tspan>
            <tspan x="0" y="186.328522" textLength="72">the court.</tspan>
            <tspan x="0" y="218.728516" textLength="63">Alice:I&apos;m</tspan>
            <tspan x="63" y="218.728516" textLength="4.125"> </tspan>
            <tspan x="67.125" y="218.728516" textLength="364.25">not a mile high, so I&apos;m not leaving! You made that
            </tspan>
            <tspan x="431.375" y="218.728516" textLength="4.125"> </tspan>
            <tspan x="0" y="251.12851" textLength="100.25">rule just now.</tspan>
            <tspan x="0" y="283.528534" textLength="80.25">King:That&apos;s</tspan>
            <tspan x="80.25" y="283.528534" textLength="4.125"> </tspan>
            <tspan x="84.375" y="283.528534" textLength="198.375">the oldest rule in the book.</tspan>
            <tspan x="0" y="315.928558" textLength="76.875">Alice:Then</tspan>
            <tspan x="76.875" y="315.928558" textLength="4.125"> </tspan>
            <tspan x="81" y="315.928558" textLength="221.375">it should be Rule Number One</tspan>
            <tspan x="302.375" y="315.928558" textLength="5.875">!</tspan>
            <tspan x="308.25" y="315.928558" textLength="9" font-family="宋体"> </tspan>
            <tspan x="317.25" y="315.928558" textLength="5.5">(</tspan>
            <tspan x="322.75" y="315.928558" textLength="108.75">The King&apos;s face</tspan>
            <tspan x="431.5" y="315.928558" textLength="4.125"> </tspan>
            <tspan x="0" y="348.328583" textLength="241.5">goes white, but he says nothing.)</tspan>
            <tspan x="0" y="380.7286" textLength="96.25">White Rabbit</tspan>
            <tspan x="96.25" y="380.7286" textLength="10.375">:(</tspan>
            <tspan x="106.625" y="380.7286" textLength="335.125">waving a piece of paper) Oh, we&apos;ve just found
            </tspan>
            <tspan x="441.75" y="380.7286" textLength="4.125"> </tspan>
            <tspan x="0" y="413.128632" textLength="71.125">this letter</tspan>
            <tspan x="71.125" y="413.128632" textLength="4.5">.</tspan>
          </text>
        </g>
      </g>

            <tspan x="79.25" y="251.12851" textLength="325.875">! Off with the Knave&apos;s head! The jury can say

            <tspan x="0" y="348.328583" textLength="192.25">The jury must decide first!</tspan>
